	  array('id' => '47','name' => 'Turn Signal Wheels','type' => 'auto','type_info' => '{"ahmed":false,"part_number":"522882","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'We reproduce direct fit replacement turn signal canceling wheels for 1960-1972 Series Land Rovers fitted with the “Tex Magna-Lite” turn signal switch. The rubber canceling wheel is nearly always dried, cracked, crumbling or just plain missing. After years of being unavailable, we are now making them. No other supplier in the world offers these, only Pangolin 4x4 has them. Full color fitting instructions and a guarantee of satisfaction. ','tags' => 'Hand-Controls,P4x4-Fabrication','x' => '1.50','y' => '0.25','z' => '0.25','weight' => '0.02','flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => 'U9-2','created_at' => '2016-02-10 16:28:51','updated_at' => '2016-04-29 19:36:18'),
	  array('id' => '48','name' => 'Brass Split Rivets','type' => 'auto','type_info' => '{"ahmed":true,"part_number":"68087","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'These special bifurcated rivets were used on a number of applications on Series Land Rovers from 1948-1964. These have been unavailable for years, and we are finally producing these fasteners to original specification, including special washers. 

	Applications include: 
	- 80-inch handbrake and 4WD shift boots
	- Hood/bonnet buffer strips from ‘48-64
	- Apron panel buffer strips from ’58-64
	- Windshield buffer strips from ’48-53. 

	Sold in sets (1 Rivet, 1 Washer). Discount for purchase of 20 sets at a time.','tags' => 'Body-Fittings','x' => '1.00','y' => '1.00','z' => '1.00','weight' => '0.10','flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => 'U7-2','created_at' => '2016-02-10 16:28:52','updated_at' => '2016-04-26 20:52:22'),
	  array('id' => '50','name' => 'Series One Windshield Buffer Strip','type' => 'auto','type_info' => '{"ahmed":true,"part_number":"","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'We have sourced the correct material for these early windshield buffer strips, used on 1948-1953 models.  Kit includes two buffers, and two sets of special bifurcated rivets and washers. ','tags' => 'Windows,P4x4-Fabrication','x' => NULL,'y' => NULL,'z' => NULL,'weight' => '0.10','flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => NULL,'created_at' => '2016-02-10 16:28:55','updated_at' => '2016-02-29 22:28:20'),
	  array('id' => '52','name' => 'Reproduction Data Plates','type' => 'auto','type_info' => '{"ahmed":false,"part_number":"","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'We offer reproduction chassis number plates to suit Series One, Series II, Series IIA, & Series III 88 and 109 Series Land Rovers. These are laser etched on anodized aluminum plates. Faithful to the original design and dimensions, these plates are perfect for an original restoration, or to replace a faded or damaged plate. We also offer VIN number stamping for an additional charge. Please provide your VIN number in the notes at checkout if you would like this service. ','tags' => 'P4x4-Fabrication,Data-Plates','x' => NULL,'y' => NULL,'z' => NULL,'weight' => NULL,'flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => NULL,'created_at' => '2016-02-10 16:28:57','updated_at' => '2016-02-24 23:24:11'),
