	  array('id' => '56','name' => 'Door Buffers, Series One 80-inch ','type' => 'auto','type_info' => '{"ahmed":true,"part_number":"","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'These replace the door stop rubber buffers on Series One 80 inch models from 1948-1953. Exact duplicate of the no longer available parts. Each set includes 4 buffers.','tags' => 'Body-Fittings','x' => '1.00','y' => '1.00','z' => '1.00','weight' => '0.10','flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => 'U9-1','created_at' => '2016-02-10 16:29:00','updated_at' => '2016-04-29 20:33:28'),
	  array('id' => '57','name' => 'Wiper Rack Boot, Late Series IIA','type' => 'auto','type_info' => '{"ahmed":true,"part_number":"338846","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":true,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'Those who have a late Series IIA Land Rover (1968 to 1972) will recognize this rubber boot which covers the rectangular hole in the top of the firewall through which the wiper rack passes. Replace your rotted or missing original with this high quality reproduction. ','tags' => 'Seals,Wiper/Washer,Featured,Frontpage','x' => '3.00','y' => '3.00','z' => '2.00','weight' => '0.10','flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => '','created_at' => '2016-02-10 16:29:00','updated_at' => '2016-05-10 17:40:40'),
	  array('id' => '58','name' => 'Carburetor Elbow, Series One 80-inch ','type' => 'auto','type_info' => '{"ahmed":false,"part_number":"","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":true,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'For Land Rovers made between 1948 and 1953 this kit replaces the original rotted or aged carburetor elbow and gasket on all 80 inch models with 1.6 and 2.0L engines. Your engine will thank you for it. ','tags' => 'Carburetor','x' => NULL,'y' => NULL,'z' => NULL,'weight' => NULL,'flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => NULL,'created_at' => '2016-02-10 16:29:01','updated_at' => '2016-02-24 23:29:39'),
	  array('id' => '59','name' => 'Tire Mount Hood Buffers','type' => 'auto','type_info' => '{"ahmed":true,"part_number":"MRC5627","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'These buffers protect the hood from the spare tire and rim when the optional bonnet-mounted spare-tire carrier is fitted. Early style buffers like these are no longer available. Made from top quality, durable, UV-stable rubber. These will take a beating and keep looking good for years to come. Requires 4 slotted pan head screws 10-32 x 5/8 and corresponding lock washers/nuts for installation.','tags' => 'Hood','x' => NULL,'y' => NULL,'z' => NULL,'weight' => NULL,'flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => NULL,'created_at' => '2016-02-10 16:29:01','updated_at' => '2016-02-24 23:30:36'),
	  array('id' => '60','name' => 'Transmission Tunnel Plugs','type' => 'auto','type_info' => '{"ahmed":true,"part_number":"334189","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'Replace your aging, rotted transmission tunnel plug with a new one. Thermal cycling, grease, and oil from the drive train limit the life expectancy of the original plugs. These more durable plugs should last and last, as well as help you seal the air gaps in your floor.','tags' => 'Gearbox-Housing','x' => '4.00','y' => '4.00','z' => '1.00','weight' => '0.18','flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => 'Unit 9-2','created_at' => '2016-02-10 16:29:02','updated_at' => '2016-04-29 19:50:06'),
	  array('id' => '61','name' => 'Koenig Decals','type' => 'auto','type_info' => '{"ahmed":false,"part_number":"","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'These reproduction Koenig Iron Works decals are for Land Rovers fitted with Koenig PTO winches. Koenig Iron Works was one of the early winch manufacturers and their “king” winches were a dealer option on North American trucks. High quality die cut UV-resistant vinyl. Adheres to the inside of window glass for maximum life. ','tags' => 'P4x4-Fabrication,Winches','x' => NULL,'y' => NULL,'z' => NULL,'weight' => NULL,'flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => NULL,'created_at' => '2016-02-10 16:29:03','updated_at' => '2016-02-24 23:32:09'),
	  array('id' => '62','name' => 'Pangolin 4x4 Series Bumpers','type' => 'auto','type_info' => '{"ahmed":false,"part_number":"","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'Fit a bumper that’s as tough as the rest of your truck! Pangolin 4x4 bumpers are designed to be a direct replacement for the factory fitted units. These bumpers look like the genuine item, but offer strength and durability far superior to the original. Every bumper is made to order from 3/16 inch steel plate with 1/4 inch plate reinforcements and mounts. Available with winch mounts for the Warn 8274, Koenig, and other winches. Pangolin 4x4 bumpers will take a beating and look good doing it. Available uncoated, powder coated, or galvanized.','tags' => 'Chassis,P4x4-Fabrication,Featured','x' => NULL,'y' => NULL,'z' => NULL,'weight' => NULL,'flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => NULL,'created_at' => '2016-02-10 16:29:04','updated_at' => '2016-03-24 17:26:46'),
	  array('id' => '63','name' => 'Delco Alternator Conversion Kit','type' => 'auto','type_info' => '{"ahmed":false,"part_number":"","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'Convert your Rover’s charging system to a powerful, reliable, readily available Delco Alternator with these brackets. This kit allows you to mount a Delco 10Si alternator to your 2.25L engine block, eliminating the expensive and low output Lucas alternators and generators. Already have a Delco? These brackets are a nice way to tidy up your engine bay, make your charging system more accessible, and rid yourself of stacks of washers, threaded rod and other farmer fixes. These sturdy brackets take a readily available Gates, NAPA, or Goodyear belt. Add the Molex Plug for an additional $6.00','tags' => 'P4x4-Fabrication,Alternator','x' => NULL,'y' => NULL,'z' => NULL,'weight' => NULL,'flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => NULL,'created_at' => '2016-02-10 16:29:11','updated_at' => '2016-02-24 23:42:10'),
	  array('id' => '64','name' => 'Pangolin 4x4 Tow Hitch','type' => 'auto','type_info' => '{"ahmed":false,"part_number":"","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'The standard towing equipment provided with Series Land Rovers is not very useful today. Besides its negative effect on departure angle, it is very limited in its ability to handle modern towing apparatus. The Pangolin 4x4 receiver hitch allows the use of all Class 3 receiver implements. This means you can now fit anything from standard drop hitches to bike racks to your Series Land Rover. It also installs in the factory mounting holes and provides a greater departure angle than any other receiver available. Constructed from 1/4 and 3/8 inch steel, it has a provision for attaching a safety chain or shackle, in addition to a receiver implement.','tags' => 'Body-Fittings,P4x4-Fabrication','x' => '7.50','y' => '7.00','z' => '6.50','weight' => '13.16','flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => NULL,'created_at' => '2016-02-10 16:29:12','updated_at' => '2016-03-18 18:39:36'),
	  array('id' => '65','name' => 'Pangolin 4x4 Skid Plates','type' => 'auto','type_info' => '{"ahmed":false,"part_number":"","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'The standard Series Land Rover under seat fuel tank is extremely vulnerable to damage due to its low-hanging design. On the trail this means your truck can easily be rendered helpless due to a ruptured tank. Don’t take a chance on becoming stranded. Protect your tank with the Pangolin 4x4 tank skid plate.  

	Constructed from 3/16 inch plate, these skids wrap the fuel tank in a protective layer of steel.  Available uncoated, powder coated, or galvanized.','tags' => 'Body-Fittings,P4x4-Fabrication,Featured','x' => '28.00','y' => '14.50','z' => '5.25','weight' => '26.86','flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => NULL,'created_at' => '2016-02-10 16:29:15','updated_at' => '2016-04-20 18:23:32'),
	  array('id' => '66','name' => 'Machined Shackle Bracket','type' => 'auto','type_info' => '{"ahmed":false,"part_number":"","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'Machined shackle bracket for 3/4 inch bow shackle. One inch thick. These are burly and perfect for you next project. ','tags' => 'P4x4-Fabrication,Body-Fittings','x' => NULL,'y' => NULL,'z' => NULL,'weight' => NULL,'flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => NULL,'created_at' => '2016-02-10 16:29:18','updated_at' => '2016-02-24 23:43:36'),
