	  array('id' => '71','name' => 'Wiper Seals, Early Wiper Motor','type' => 'auto','type_info' => '{"ahmed":false,"part_number":"302987","ss_part_number":"","state":"New","quality":"Reproduction","manufacturer":"","base_80":false,"base_86":false,"base_88":false,"base_107":false,"base_109":false,"sI":false,"sII":false,"sIIA":false,"l_sIIA":false,"sIIB":false,"sIII":false,"stage_one_v8":false,"defender":false,"range_rover":false,"discovery":false,"other_applications":""}','public' => '1','description' => 'These reproduction wiper motor seals for use with Series One, Series II, & Series IIA, are produced solely by Pangolin 4x4. Water has a tendency to enter the wiper motor housing due to the angle at which it is mounted to the firewall. This water is no good for the internals. Keep your wipers wiping with these reproduction seals! ','tags' => 'Wiper/Washer,P4x4-Fabrication','x' => '2.50','y' => '1.00','z' => '0.20','weight' => '0.10','flat_shipping' => NULL,'oversized' => NULL,'shipping_cost' => NULL,'location' => 'U9-2','created_at' => '2016-02-10 16:29:20','updated_at' => '2016-05-06 17:59:48'),
